window.bookSummaryJSON = "<p><b>My ex tried to take everything from me.</b></p> <p>My last chance at happiness.</p> <p>One of the men I've given my heart to.</p> <p>While before, he was content to terrorize me to get what he wanted, now his ambitions have widened. He's got the whole town in his sights, and he doesn't care who he has to hurt to get what he wants.</p> <p>But that's OK.</p> <p>I've let him ride roughshod over me for way too long, and now? Me and my mates are going to push back, and he doesn't know what's coming for him.</p> <p>No cliffhangers. This is the end of Natalie's story</p>"; 
